pragma solidity >=0.4.21 <0.6.0;

// TODO define a contract call to the zokrates generated solidity contract <Verifier> or <renamedVerifier>
import './Verifier.sol';
import './ERC721Mintable.sol';


// TODO define another contract named SolnSquareVerifier that inherits from your ERC721Mintable class
contract SolnSquareVerifier is PatriciaERC721Token, Verifier{

  // TODO define a solutions struct that can hold an index & an address
  struct Solution {
      address to;
      uint256 tokenId;
  }


// TODO define a mapping to store unique solutions submitted
mapping(bytes32 => Solution) uniqueSolutions;


// TODO Create an event to emit when a solution is added
event SolutionAdded(bytes32 key);


// TODO Create a function to add the solutions to the array and emit the event
function addSolution(
  address to,
  uint256 tokenId,
  uint[2] memory a,
  uint[2] memory a_p,
  uint[2][2] memory b,
  uint[2] memory b_p,
  uint[2] memory c,
  uint[2] memory c_p,
  uint[2] memory h,
  uint[2] memory k,
  uint[2] memory input
  ) public whenNotPaused returns(bytes32)
    {

        bytes32 key = keccak256(abi.encodePacked(a, b, c, input));

        require(uniqueSolutions[key].tokenId == 0, "Solution already submitted");
        require(verifyTx(a, a_p, b, b_p, c, c_p, h, k, input), "Solution is incorrect");

        uniqueSolutions[key] = Solution({to: to, tokenId: tokenId});

        emit SolutionAdded(key);
        return key;
    }


// TODO Create a function to mint new NFT only after the solution has been verified
//  - make sure the solution is unique (has not been used before)
//  - make sure you handle metadata as well as tokenSuplly
function mintToken(bytes32 key) public whenNotPaused 
    {

        require(uniqueSolutions[key].to != address(0), "Solution is already used");

        super.mint(uniqueSolutions[key].to, uniqueSolutions[key].tokenId);

        // mark solution as used
        uniqueSolutions[key].to = address(0);

    }
}
